import websiteLogo from '../resources/CookieDoughLogo.svg';
import cartLogo from '../resources/cart.svg';
import profileLogo from '../resources/profile.svg';
import './Header.css';

function Header(){
    return(
    <div className= 'header-bar'>
        <div className= 'div-right'>
            <img src= {websiteLogo} className= 'website-logo'></img>
        </div>
        <div className= 'div-center'>
            <form>
                <input placeholder= 'Search'></input>
                <button type= 'submit'></button>
            </form>
        </div>
        <div className= 'div-left'>
            <img src= {cartLogo} className= 'header-icon'></img>
            <img src= {profileLogo} className= 'header-icon'></img>
        </div>
    </div>)
}

export default Header;
